import React from 'react';

function Purito() {
	return (
		<div className="page">
			<h1>Purito</h1>
			<div className="content">
				<h2>프로젝트 소개</h2>
				<p>Purito는 화장품 브랜드 디자인 프로젝트입니다.</p>

				<h3>주요 작업 내용</h3>
				<ul>
					<li>화장품 패키지 디자인</li>
					<li>브랜드 아이덴티티</li>
					<li>제품 라벨 디자인</li>
					<li>마케팅 자료 디자인</li>
				</ul>

				<h3>사용 기술</h3>
				<p>Adobe Illustrator, Photoshop, InDesign</p>
			</div>
		</div>
	);
}

export default Purito;
